using System;\nusing System.Linq;\nusing Excel = Microsoft.Office.Interop.Excel;\n\nclass DynamicExcel\n{\n    static void Main()\n    {\n        // Create an instance of the Excel application.\n        var app = new Excel.Application { Visible = true };\n        \n        // Add a new workbook.\n        app.Workbooks.Add();\n\n        // Get reference to the active worksheet.\n        Excel.Worksheet workSheet = (Excel.Worksheet)app.ActiveSheet;\n\n        // Define the range from A1 to T1.\n        Excel.Range range = workSheet.Range["A1", "T1"];\n\n        // Fill the range with values 1 through 20.\n        range.Value2 = Enumerable.Range(1, 20).ToArray();\n\n        // Clean up references.\n        System.Runtime.InteropServices.Marshal.ReleaseComObject(range);\n        System.Runtime.InteropServices.Marshal.ReleaseComObject(workSheet);\n        app.Quit();\n        System.Runtime.InteropServices.Marshal.ReleaseComObject(app);\n    }\n}